import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Services from "./components/Services";
import Testimonials from "./components/Testimonials";
import Contact from "./components/Contact";
import Login from "./pages/Login";
import PatientRegister from "./pages/PatientRegister";  // No changes
import DoctorRegister from "./pages/Doctor/DoctorRegister";    // No changes
import PharmacyRegister from "./pages/PharmacyRegister";  // No changes

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/services" element={<Services />} />
        <Route path="/testimonials" element={<Testimonials />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register/patient" element={<PatientRegister />} />
        <Route path="/register/doctor" element={<DoctorRegister />} />
        <Route path="/register/pharmacy" element={<PharmacyRegister />} />
      </Routes>
    </Router>
  );
}

export default App;
